    false,nt"url": null,nt"notes": "NODC Accession 0115709 includes chemical,
    discrete sample, physical and profile data collected from SHUMPU MARU in the Philippine
    Sea from 1992-02-25 to 1992-02-29 and retrieved during cruise PACIFICA_49SU19920225
    and PCM05 / 49SU9202_4. These data include DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
    NITRATE, NITRITE, PHOSPHATE, SALINITY, WATER TEMPERATURE and pH. The instruments
    used to collect these data include CTD and bottle. These data were collected by
    Nobuo Sato and Sukeyoshi Takatani of Kobe Marine Observatory as part of the PACIFICA_49SU19920225
    data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
    project for the data synthesis of ocean interior carbon and its related parameters
    in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
